import styled from 'styled-components';

const Wrapper = styled.section`
  margin: 0 auto;
  max-width: var(--max-width-content);

  .bigcard_box {
    display: flex;
    background: #000;
    height: 50rem;
    span {
      color: red;
    }
  }
`;
export default Wrapper;
